Description: 

Dameware Remote Support 9.0 (DRS) - is an enterprise system management platform Windows NT/2000/XP/2003/Vista, allowing administrators to circumvent the restrictions Microsoft Management Console (MMC). DRS includes a large number of administrative tools Microsoft Windows NT, incorporated within a centralized interface for remote management of servers and workstations Windows. Virtually all of the standard utilities are included in the DRS, accessible style interface, many of which have been greatly enhanced to provide superior performance, added functionality, and ease of use. DRS also includes specialized tools, such as the DameWare Mini Remote Control and the Exporter, and also supports the standard property pages and shell context menu.
DRS includes a powerful object browser Active Directory, as well as advanced functionality for retrieving, searching, and filtering objects and attributes of Active Directory. Management of objects such as OU (Organizational Units), Containers, Users, Groups, Contacts, Computers, &amp; Shares, as well as attributes that are not available within Microsoft MMC (ie Photos, Logos, employee ID, etc. .).

